import React from "react";
import Slider from "react-slick";

import "./Skills.css";

import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

// Correct the import paths for the images
import html from "../../../images/homeimages/skillsimages/html.svg";
import css from "../../../images/homeimages/skillsimages/css.svg";
import javascript from "../../../images/homeimages/skillsimages/javascript.svg";
import reactjs from "../../../images/homeimages/skillsimages/react.svg";
import ruby from "../../../images/homeimages/skillsimages/ruby.svg";
import rubyonrails from "../../../images/homeimages/skillsimages/RoR.svg";
import postgresql from "../../../images/homeimages/skillsimages/postgresql.svg";

const Skills = () => {
  const settings = {
    dots: false, // Disable dots if needed
    infinite: true, // Enable infinite scrolling
    speed: 6000, // Set speed for smoothness (higher value for slower, more continuous transition)
    slidesToShow: 4, // Show multiple slides at once
    slidesToScroll: 1, // Scroll one slide at a time
    autoplay: true, // Enable autoplay
    autoplaySpeed: 0, // No delay between slides
    cssEase: "linear", // Create a smooth linear transition effect
    arrows: false, // Disable arrows if not needed
    pauseOnHover: false, // Continue scrolling on hover
    pauseOnFocus: false, // Continue scrolling even when focused

    // Enable dragging/swiping with mouse or touch
    draggable: true, // Allows users to drag slides with the mouse
    swipe: true, // Allows touch/swipe support
    swipeToSlide: true, // Allows users to swipe directly to any slide
  };

  return (
    <section className="skills">
      <h2 className="title">Skills</h2>
      <Slider {...settings}>
        <div className="inner-skill-pack">
          <h3 className="skill-title">HTML</h3>
          <img src={html} alt="HTML" />
        </div>
        <div className="inner-skill-pack">
          <h3 className="skill-title">CSS</h3>
          <img src={css} alt="CSS" />
        </div>
        <div className="inner-skill-pack">
          <h3 className="skill-title">JavaScript</h3>
          <img src={javascript} alt="JavaScript" />
        </div>
        <div className="inner-skill-pack">
          <h3 className="skill-title">React</h3>
          <img src={reactjs} alt="React" />
        </div>
        <div className="inner-skill-pack">
          <h3 className="skill-title">Ruby</h3>
          <img src={ruby} alt="Ruby" />
        </div>
        <div className="inner-skill-pack">
          <h3 className="skill-title">Ruby on Rails</h3>
          <img src={rubyonrails} alt="Ruby on Rails" />
        </div>
        <div className="inner-skill-pack">
          <h3 className="skill-title">POSTGRESQL</h3>
          <img src={postgresql} alt="PostgreSQL" />
        </div>
      </Slider>
    </section>
  );
};

export default Skills;
